import { StyleSheet, ImageBackground, Image } from "react-native";
import { NativeBaseProvider, Center, Text, Box, Heading, Header, Divider, Stack, HStack, AspectRatio } from 'native-base';
import { Ionicons } from '@expo/vector-icons';
import { ScrollView } from "react-native-gesture-handler";

export default function TabTwoScreen() {
  return (
    <NativeBaseProvider>
      <AppBar />
      <ScrollView>
        <Divider />
        <Center>
          <Example />
          <Example />
          <Example />
          <Example />
          <Example />
          <Example />
          <Example />
          <Example />
        </Center>
      </ScrollView>
    </NativeBaseProvider>
  );
}

function AppBar() {
  return (
    <>
      <Box safeAreaTop backgroundColor="#f2e6d9" />

      <HStack bg='#e6e600' px="1" justifyContent='space-between' alignItems='center'>
        <HStack space="4" alignItems='center'>
          <Image style={styles.coin} source={require('../assets/images/crewcoinlogo.png')} />
        </HStack>
        <HStack space="4">
          <Text style={styles.icon}>
            David Williams
          </Text>
        </HStack>
      </HStack>

    </>
  )
}

export const Example = () => {
  return (
    <Box
      py="5"
      style={styles.image}
      maxW="80"
      rounded="lg"
      overflow="hidden"
      borderColor="coolGray.200"
      borderWidth="1"
      _dark={{
        borderColor: "coolGray.600",
        backgroundColor: "gray.700",
      }}
      _web={{
        shadow: 2,
        borderWidth: 0,
      }}
      _light={{
        backgroundColor: "gray.50",
      }}
    >
      <Box>
        <AspectRatio w="100%" ratio={52 / 9}>
          <Image
            source={require('../assets/images/icon2.gif')}
            alt="image"
          />
        </AspectRatio>
      </Box>
      <Stack p="4" space={3}>
        <Stack space={2}>
          <Heading size="md" ml="-1">
            "Willing to Clean for Coins? :)"
          </Heading>
        </Stack>
        <Text fontWeight="400">
          We need extra help with cleaning today! See your manager for more details!
        </Text>
        <HStack alignItems="center" space={4} justifyContent="space-between">
          <HStack alignItems="center">
            <Text
              color="coolGray.600"
              _dark={{
                color: "warmGray.200",
              }}
              fontWeight="400"
            >
              6 mins ago
            </Text>
          </HStack>
        </HStack>
      </Stack>
    </Box>
  )
}


const styles = StyleSheet.create({
  container: {
    flex: 1,
    alignItems: "center",
    justifyContent: "center",
  },
  icon: {
    color: 'black',
    fontSize: 16,
    fontWeight: 'bold',


  },
  balance: {
    fontSize: 25,
    width: '100%',
  },
  coin: {
    width: 200,
    resizeMode: 'contain',
    height: 50,
  },
  coingif: {
    size: '100%',
  },
  coingif: {
    width: 10,
  },
  image: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
    width: '100%',
  },
  title: {
    width: 400,
    resizeMode: 'cover',
    marginTop: -100,
    marginBottom: -100,
    margin: -100,
  },
  header: {
    marginTop: '15%',
    marginLeft: '18%',
    justifyContent: 'flex-start',
    alignItems: 'flex-start',
    backgroundColor: '#fff',
  },
  center: {
    flex: 1,
    justifyContent: "center",
    alignItems: "center",
  },
});
